    //  .then(data => setList(data))
    //  .catch(error => console.error('Error fetching data:', error));
  //}, []);

  return (
    <div>
      <p>안녕</p>
      <ul>
        {list.map(item => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default Main;
